 initial; background-repeat: initial;\">\r\n	<strong><span style=\"font-size:24px;\">众志开来</span></strong></p>\r\n<p class=\"p0\" style=\"line-height: 200%; margin-top: 0pt; text-indent: 24pt; margin-bottom: 0pt; word-break: break-all; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">\r\n	<strong><span style=\"font-size:24px;\"><span style=\"font-size:16px;\"><img alt=\"\" src=\"/jeesite/userfiles/1/images/cms/article/2016/03/About.jpg\" style=\"width: 740px; height: 201px;\" /></span></span></strong></p>\r\n<p class=\"p0\" style=\"line-height: 200%; margin-top: 0pt; text-indent: 24pt; margin-bottom: 0pt; word-break: break-all; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">\r\n	<span style=\"font-family: 宋体; font-size: 12pt; line-height: 200%; text-indent: 24pt;\">开来橱柜1998年成立于北京，至今已走过十六年的辉煌历程。&nbsp;成立之初就立志于全国性品牌树立，05年成立南京公司，同年建立南京生产基地。目前开来拥有 北京、南京、杭州、合肥、太原等城市二十余家直营店及全国三百余家加盟店。南北两个生产基地，以德国豪迈电子开料锯、豪迈预铣跟踪全自动封边机等数字化生 产设备，辅以2020以及德国IMOS柔性制造技术，每月可向市场提供5000余套橱柜供货能力的全国连锁经营企业，以打造德式温馨功能化厨柜及产品的高 性价比，让开来橱柜唱响全国。2013年公司连续承接了多个千万级工程配套项目，让公司跨入了崭新的市场平台。</span></p>\r\n<p class=\"p0\" style=\"line-height: 200%; margin-top: 0pt; text-indent: 24pt; margin-bottom: 0pt; word-break: break-all; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">\r\n	<span style=\"font-family: \'宋体\'; font-size: 12pt; mso-spacerun: \'yes\'\">开 来坚持以质量求生存，为提高管理水平始终作不懈努力。2002年开来与北京清软软件公司共同开发了先进的ERP生产管理系统，全面整合了产、供、销、存 储、售后服务等环节。2003年开来同全国重点大学---北京林业大学建立了合作关系，将德国Hettich32mm板式家具生产系统应用到生产过程中， 严格执行了板式家具生产工艺标准。&nbsp;2012年办公自动化系统全面网络化升级，同年2020自动设计系统软件销售系统全面开始使用。</span><span style=\"font-family: \'Arial\'; font-size: 12pt; mso-spacerun: \'yes\'\"><o:p></o:p></span></p>\r\n<p class=\"p0\" style=\"line-height: 200%; margin-top: 0pt; text-indent: 24pt; margin-bottom: 0pt; word-break: break-all; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">\r\n	<span style=\"font-family: \'宋体\'; font-size: 12pt; mso-spacerun: \'yes\'\">南 方市场开拓也更取得卓越成效，中国橱柜十大品牌、中国厨卫百强企业、中国橱柜出口认证企业、十佳网络营销企业等荣誉接踵而至，这也是对辛勤耕耘的开来人的 一种肯定。迄今为止，开来橱柜取得了实用型专利技术3项（&ldquo;莱茵秋色&rdquo;柜体，&ldquo;IPHONE&rdquo;门板，四层台面结构），并还有多项专利正在申请中。</span><span style=\"font-family: \'Arial\'; font-size: 12pt; mso-spacerun: \'yes\'\"><o:p></o:p></span></p>\r\n<p class=\"p0\" style=\"line-height: 200%; margin-top: 0pt; text-indent: 24pt; margin-bottom: 0pt; word-break: break-all; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">\r\n	<span style=\"font-family: \'宋体\'; font-size: 12pt; mso-spacerun: \'yes\'\">开来橱柜以国际化的视野和领先的设计、用心服务的理念创造出符合中国家居生活使用的厨房系列产品，坚持&ldquo;德国原材，健康开来&rdquo;的品牌理念，追求健康环保产品，打造行业第一健康品牌。&nbsp;</span></p>','','','1'),('5','文章内容内容内容内容','来源','1,2,3','1'),('50','文章内容内容内容内容','来源','1,2,3','1'),('51','文章内容内容内容内容','来源','1,2,3','1'),('52','文章内容内容内容内容','来源','1,2,3','1'),('53','文章内容内容内容内容','来源','1,2,3','1'),('6','文章内容内容内容内容','来源','1,2,3','1'),('7','文章内容内容内容内容','来源','1,2,3','1'),('7cdebd3898f748b68071326b95151a90','<p>\r\n	hahah</p>\r\n<p>\r\n	hahah</p>\r\n<p>\r\n	qq</p>\r\n<p>\r\n	q</p>\r\n<p>\r\n	aaa</p>\r\n<p>\r\n	qq</p>\r\n<p>\r\n	<img alt=\"\" src=\"/jeesite/userfiles/1/images/cms/article/2016/03/About.jpg\" style=\"width: 1200px; height: 201px;\" /></p>','ziji','','1'),('8','文章内容内容内容内容','来源','1,2,3','1'),('9','文章内容内容内容内容','来源','1,2,3','1');
